//이름 변경 로직
export const changeUserNameDB = (requestData) => {
  console.log(requestData);
  return new Promise((resolve, reject) => {
    try {
      const response = axios({
        method: "post", //@RequestBody
        url: "http://localhost:8000/user/changeUserName", 
        data: requestData,
      });
      resolve(response);
    } catch (error) {
      reject(error);
    }
  });
};
